import React from 'react'

const data = {
    1:{id:1, status:'shipped', loc:'MN'},
    2:{id:2, status:'shipped', loc:'TX'}};

const md = [1,2,3]

const listItems = md.map(([key, value]) =>
  <div>{key}</div>
)

const ShipmentTable = () => {
  return (
    <div className="tableBody">
      <div className="tableRow">
        <div className="tableHeadItem">Tracking ID</div>
        <div className="tableHeadItem">Status</div>
        <div className="tableHeadItem">Location</div>
      </div>
      {
        listItems
      }
    </div>
  )
}



export {
  ShipmentTable
}
